    [],nt"revision_timestamp": "2015-07-08T19:20:14.656840",nt"name": "public-use-microdata-samples-pums",nt"isopen":
    true,nt"url": null,nt"notes": "Public Use Microdata Samples (PUMS) are
    computer-accessible files containing records for a sample of housing units, with
    information on the characteristics of each housing unit and the people in it for
    1940-1990. Within the limits of sample size and geographical detail, these files
    allow users to prepare virtually any tabulations they require. Each datafile is
    documented in a codebook containing a data dictionary and supporting appendix information.
    Electronic versions for the codebooks are only available for the 1980 and 1990 datafiles.
    Identifying information has been removed to protect the confidentiality of the respondents.
    PUMS is produced by the United States Census Bureau (USCB) and is distributed by
    USCB, Inter-university Consortium for Political and Social Research (ICPSR), and
    Columbia University Center for International Earth Science Information Network (CIESIN).",nt"license_title":
